$(document).ready(function(){$.ajax({url:PRICES_LOG_PATH,dataType:"text",success:function(data){var all_prices=data.split('\n');$.each(all_prices,function(index,val){var price=val.split('|');var symbol=price[0];var symbol_el=$('.quote[data-symbol="'+symbol+'"]');if(symbol_el.length>0){symbol_el.find('.bid_1').html(price[1].substring(0,4));symbol_el.find('.bid_2').html(price[1].substring(4,6));symbol_el.find('.bid_3').html(price[1].substring(6,7));symbol_el.find('.ask_1').html(price[2].substring(0,4));symbol_el.find('.ask_2').html(price[2].substring(4,6));symbol_el.find('.ask_3').html(price[2].substring(6,7));symbol_el.find('.spread').html(price[3]);if(price[5]=="0"){symbol_el.find('.direction').addClass("fa arrow-down text-danger");}else if(price[5]=="1"){symbol_el.find('.direction').addClass("fa arrow-up text-success");}}});connect();}});});;